const Navbar = () => {
    return (
        <nav className='navbar bg-dark'>
            <h1><a href="index.html">
                <i className="fas fa-code" /> Hi
            </a>
            </h1>
            <ul>
                <li>
                    <a href="profiles.html" />
                </li>
            </ul>

        </nav>
    )
}

export default Navbar;
